import menu1 from '../Images/coffee-menu.jpg'
import menu2 from '../Images/croissant-menu.jpg'
import menu3 from '../Images/dessert-menu.jpg'

const Menu = () => {
    return ( 
        <div>
        <img src = {menu1} />
        <img src = {menu2} />
        <img src = {menu3} />
        </div>
     );
}
 
export default Menu;
